body:
@gunan However when I import the tensorflow library. I am getting the below warning.

`>>> import tensorflow
/home/ubuntuvm/anaconda3/lib/python3.6/importlib/_bootstrap.py:219: RuntimeWarning: compiletime version 3.5 of module 'tensorflow.python.framework.fast_tensor_util' does not match runtime version 3.6
  return f(*args, **kwds)
`

I assume the above warning is just a normal warning because I tried in a diffrent ubuntu machine where it installed properly. And yes I used the 1.4.0 version. And upon importing the library in python I still got the same warning.
